import data from "../../Data/tshirtimages.json";
import ProductDetail from "../Products/ProductDetail";

export default function ProductList() {
  return (
    <div>
      {data.map((items) => (
        <ProductDetail key={items.id} items={items}></ProductDetail>
      ))}
    </div>
  );
}
